import * as React from 'react'
import Footer from '../components/Footer/Footer'
import Card from '../components/Card/Card'

function Location({children}) {

    return (
        <div>
            <Card>
                {children}
            </Card>
            <Footer/>
        </div>
    )
}

export default Location
